param($installPath, $toolsPath, $package, $project)

	. (Join-Path $toolsPath "CommonPropertyValues.ps1")

	$referenceFileFullPath = "$installPath\lib\net40\$referenceAssemblyName.dll"
	$libFolder = "$installPath\lib"

	if(Test-Path $libFolder)
	{
		$dotNetFolder = Get-ChildItem $libFolder | Where { $_.PSIsContainer -and $_.Name -match "net"} | select -First 1
		
		if($dotNetFolder -ne $null)
		{
			$referenceFileFullPath = "$installPath\lib\$($dotNetFolder.Name)\$referenceAssemblyName.dll"
		}
	}

	$project.Object.References |  Where-Object { $_.Name -eq $referenceAssemblyName } | foreach { $_.Remove() }
	$project.Object.References.Add($referenceFileFullPath)
	$project.Save()
